class Header extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            Name:"Shah",
            course: "Adit",
            greet:"Welcome to React World"

        }
    }
   render(){
       return(
           <div>
               <h1>Hello {this.state.Name}</h1>
               <h1>Your Course is {this.state.course}</h1>
           </div>
       );
   }
}


export default Header;
